const Palindrome = () => {
    return (
        <div className="puzzleBox filterStringPB">
            <h4>Palindrome Checker</h4>
            <input className="inputLine placeholder" placeholder="Check if a word is a palindrome" type="text"></input>
            <button className="confirmationButton">Check</button>
            <span className="resultsBox">It is {val} a palindrome</span>
        </div>
    )
}

export default Palindrome
